import React, { Component, Img } from 'react';
// eslint-disable-next-line
import { BrowserRouter as Router, Route, Link, Switch, Redirect } from 'react-router-dom';
// eslint-disable-next-line
import { Card, Badge, Row, Col, Button, Menu, Icon, Layout, Avatar} from 'antd';
// partials
// eslint-disable-next-line
import Sider from './partials/sider';
// css
import './App.css';
import 'antd/dist/antd.css';
// eslint-disable-next-line

class App extends Component {
  render() {
    let items = [1,2,3,4,44,4,4,4,4,4]
    return (
      <div className="App">
      {items.map(item => <h3>{item}</h3>)}
      </div>
    );
  }
}

export default App;
